import React from "react";
import { Route, Routes, Link, useLocation } from "react-router-dom";
import { useRef } from "react";
import { useState, useEffect } from "react";
import "./css/Computer.css";
import Home from "../Home";
import Contract from "./Contract";
import Internet from "./Internet";
import ChatComponent from "../../components/computer/ChatComponent";


function Clock() {
  const [currentTime, setCurrentTime] = useState(new Date());

  useEffect(() => {
    const timer = setInterval(() => {
      setCurrentTime(new Date());
    }, 1000);

    return () => {
      clearInterval(timer);
    };
  }, []);

  const timeString = currentTime.toLocaleTimeString([], {
    hour: "numeric",
    minute: "2-digit",
  });

  const dateString = currentTime.toLocaleDateString([], {
    year: "numeric",
    month: "numeric",
    day: "2-digit",
  });

  return (
    <div className="computer-clock">
      <p>{timeString}<br/>{dateString}</p>
    </div>
  );
}

const TaskbarMenu = React.forwardRef((props, ref) => {
    // Use ref to get a reference to the div element
    return (
      <div ref={ref} className="taskbar-menu">
        <Link to="/computer/internet">Internet</Link>
        <Link to="/computer/contract">Contract</Link>
        <Link to="/computer/chat">DOL Messager</Link>
        {/* Your other links */}
      </div>
    );
  });

const Computer = () => {
  const location = useLocation();
  const isHome = location.pathname === "/computer";

  const [isTaskbarVisible, setIsTaskbarVisible] = useState(false);
  const taskbarMenuRef = useRef();

  const toggleTaskbar = () => {
    setIsTaskbarVisible(!isTaskbarVisible);
  };

  const handleClickOutside = (event) => {
    if (taskbarMenuRef.current && !taskbarMenuRef.current.contains(event.target)) {
      setIsTaskbarVisible(false);
    }
  };

  // Attach event listener to the document when the taskbar menu is visible
  useEffect(() => {
    if (isTaskbarVisible) {
      document.addEventListener('mousedown', handleClickOutside);
    }

    // Cleanup event listener when the taskbar menu is not visible or on unmount
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [isTaskbarVisible]);

  return (
    <div className="computer-container">
      <div className="screen">
        <div className="bezel">
            <div className="taskbar-container">
            <div className="app-container">
            {isHome && (
              <>
                <Link to="internet">Internet</Link>
                <Link to="contract">Contract</Link>
                <Link to="chat">DAN  Messenger</Link>
              </>
            )}
            <Routes>
              <Route path="internet/*" element={<Internet />} />
              {/* <Route path="home" element={<Home />} /> */}
              <Route path="contract/*" element={<Contract />} />
              <Route path="chat/*" element={<ChatComponent />} />
            </Routes>
            </div>
            <div className="taskbar">
            <button onClick={toggleTaskbar} className="start-button">Start</button>
            {isTaskbarVisible && (
              <TaskbarMenu ref={taskbarMenuRef} /> // Pass ref to TaskbarMenu
            )}
              <Clock />
            </div>
            </div>

        </div>
      </div>
      <div className="keyboard">
        <div className="keys">
          <div className="key">ESC</div>
          <div className="key">F1</div>
          <div className="key">F2</div>
          <div className="key">F3</div>
          <div className="key">F4</div>
          <div className="key">F5</div>
          <div className="key">F6</div>
          <div className="key">F7</div>
          <div className="key">F8</div>
          <div className="key">F9</div>
          <div className="key">F10</div>
          <div className="key">F11</div>
          <div className="key">F12</div>
          <div className="key">HOME</div>
          <div className="key">END</div>
          <div className="key">DEL</div>
        </div>
        <div className="keys">
          <div className="key2">
            ~<br />`
          </div>
          <div className="key2">
            !<br />1
          </div>
          <div className="key2">
            @<br />2
          </div>
          <div className="key2">
            #<br />3
          </div>
          <div className="key2">
            $<br />4
          </div>
          <div className="key2">
            %<br />5
          </div>
          <div className="key2">
            ^<br />6
          </div>
          <div className="key2">
            &<br />7
          </div>
          <div className="key2">
            *<br />8
          </div>
          <div className="key2">
            (<br />9
          </div>
          <div className="key2">
            )<br />0
          </div>
          <div className="key2">
            _<br />-
          </div>
          <div className="key2">
            +<br />=
          </div>
          <div className="key3">BACKSPACE</div>
        </div>
      </div>
    </div>
  );
};

export default Computer;
